import logo from '../../logo.svg';
import './Home.css';

function Home() {
  return (
    <>
      <header>
        <div className='header'>
          <div className='header-logo'>
            <h2>Project Vault</h2>
          </div>
          <div className='header-nav-elements'>
          <ul>
  <li>Item 1</li>
  <li>Item 2</li>
  <li>Item 3</li>
</ul>

          </div>
        </div>
      </header>
      <h1>Hello , you're Home</h1>
    </>
  );
}

export default Home;
